INSERT INTO `storages` VALUES (1,NULL,1,1,'single','这是第一个题目','单选项A','单选项B','单选项C','',NULL,NULL,NULL,NULL,NULL,NULL,'C',3,5,'2011-08-24 03:22:50','2011-08-26 06:22:31'),(3,NULL,1,1,'judge','1+2+3+4=7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'true',3,5,'2011-08-24 08:09:58','2011-08-26 06:22:47'),(4,NULL,1,1,'much','以下正确的说法有','这个是不正确的','这个是正确的','这个是不错的','这个是不对的',NULL,NULL,NULL,NULL,NULL,NULL,'',5,5,'2011-08-24 13:36:43','2011-08-26 07:32:34'),(5,NULL,1,1,'much','花样百出','在','在','在','',NULL,NULL,NULL,NULL,NULL,NULL,'B',3,5,'2011-08-24 14:18:35','2011-08-24 14:18:35'),(6,NULL,1,1,'much','32+088=','3','4','55','',NULL,NULL,NULL,NULL,NULL,NULL,'B',3,5,'2011-08-24 15:08:46','2011-08-26 10:00:25'),(7,NULL,1,1,'much','这是一个多选题。','这是选项Ａ','这是选项Ｂ','这是选项Ｃ','hghhhjh','','','','','','','ABC',3,6,'2011-08-26 11:54:57','2011-10-02 13:17:04'),(8,NULL,1,1,'single','又是一个单选题，这以为是不是一个题目，这是一个题目，这是一个比较长一点的题目，现在已经达到了两行了。如果再写一些字，就快三行了，哦，现在已经是三行了。','这是一个单选Ａ','这是单选ＢＺ','这是单选Ｄ','',NULL,NULL,NULL,NULL,NULL,NULL,'C',31,3,'2011-08-27 00:43:52','2011-09-04 21:03:59'),(9,NULL,2,13,'single','在我国，制定行政法规的机关是（）。','国务院','全国人民代表大会','国务院各部、委、局','全国人民代表大会常务委员会',NULL,NULL,NULL,NULL,NULL,NULL,'A',7,5,'2011-09-06 09:00:51','2011-09-06 09:00:51'),(10,NULL,2,13,'single','法律为人们的行为提供了模式、标准、样式和方向。这体现的是法律的（）。','概括性特征','普遍性特征','规范性特征','严谨性特征',NULL,NULL,NULL,NULL,NULL,NULL,'C',9,5,'2011-09-06 09:05:06','2011-09-06 09:05:06'),(11,NULL,2,13,'single','《中华人民共和国宪法》规定：“中华人民共和国劳动者有休息的权利”。此支付宝属于法律规范中的（）。','委托性法律规范','命令性法律规范','禁止性法律规范','授权性法律规范',NULL,NULL,NULL,NULL,NULL,NULL,'D',13,5,'2011-09-06 09:07:13','2011-09-06 09:07:13'),(12,NULL,2,13,'single','全国人民代表大会常务委员会对宪法和法律的解释是（）。','立法解释','司法解释','行政解释','学理解释',NULL,NULL,NULL,NULL,NULL,NULL,'A',7,5,'2011-09-06 09:09:03','2011-09-06 09:09:03'),(13,NULL,2,13,'single','能够直接引起法律关系产生、变更和消灭的条件或情况是（）。','法律权利','法律义务','法律后果','法律事实',NULL,NULL,NULL,NULL,NULL,NULL,'D',8,5,'2011-09-06 09:10:40','2011-09-06 09:10:40'),(14,NULL,2,13,'single','在我国的法律监督体系中，从国务院到地方各级人民政府的法律监督是（）。','社会性的监督','国家权力机关的监督','国家行政机关的监督','国家司法机关的监督',NULL,NULL,NULL,NULL,NULL,NULL,'C',11,5,'2011-09-06 09:12:05','2011-09-06 09:12:05'),(15,NULL,2,13,'single','规定国家制度和社会制度的基本原则，集中表现各种政治力量对比关系，保障公民基本权利和义务的国家根本法是（）','宪法','民法','刑法','行政法',NULL,NULL,NULL,NULL,NULL,NULL,'A',11,5,'2011-09-06 09:13:35','2011-09-06 09:13:35'),(16,NULL,2,13,'single','全国人民代表大会是由（）。','各省、市、县的人民代表大会选出的代表组成','各省、市、县的人民代表大会和军队选出的代表组成','各省、自治区、真辖市的人民代表大会选出的代表级成','各省、自治区、直辖市的人民代表大会和军队选出的代表组成',NULL,NULL,NULL,NULL,NULL,NULL,'D',16,5,'2011-09-06 09:16:09','2011-09-06 09:16:09'),(17,NULL,2,13,'single','决定香港、澳门特别行政区的设立及其制度的国家机关是（）。','国务院','中央军事委员会','全国人民代表大会','',NULL,NULL,NULL,NULL,NULL,NULL,'C',9,5,'2011-09-06 09:17:43','2011-09-11 14:32:55'),(18,NULL,1,2,'judge','工工工工工工工工工工工工工',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'false',3,5,'2011-10-11 09:21:22','2011-10-11 09:21:22');
